function getWeatherColor(description) {
  const normalized = description.toLowerCase().replace(/\s+/g, ''); // lowercase and remove all spaces

  const goodConditions = ["sunny", "clear", "lightdrizzle"];
  const reasonableConditions = [
    "partlycloudy",
    "cloudy",
    "overcast",
    "patchyrainnearby",
  ];

  if (goodConditions.includes(normalized)) {
    return "green";
  } else if (reasonableConditions.includes(normalized)) {
    return "#cbcb4b"; // dark yellow
  } else {
    return "red";
  }
}


async function getWeatherBycity(city) {
  if (weather_by_city[city]) return weather_by_city[city]// if we already have data for that city don't retake it
  const url = `https://wttr.in/${encodeURIComponent(city)}?format=j1`;

  try {
    const response = await fetch(url);
    const data = await response.json();

    const forecast = data.weather.slice(0, 3).map(day => ({
      date: day.date,
      avgTemp: day.avgtempC + 'C',
      description: day.hourly[4].weatherDesc[0].value // Midday description
    }));

    weather_by_city[city] = {"text": "%cForcast: %c", "style": ["font-weight: bold;", "font-weight: normal;"]}
    forecast.forEach(day => {
      weather_by_city[city]["text"] += `${day.date}: ${day.avgTemp}, %c${day.description} %c||`
      weather_by_city[city]["style"].push(`color: ${getWeatherColor(day.description)}; font-weight: bold;`)
      weather_by_city[city]["style"].push("color: black; font-weight: normal;")
    });

    return weather_by_city[city];
  } catch (error) {
    console.error("Error:", error.message, " for city ", city);
  }
}


